REZERVOVÁNO

Pokud hledáte dlouhodobý pronájem prostorného bytu 3+kk s vlastní zahradou a vlastním krytým parkovacím stáním, je tato nabídka právě pro vás!

Byt se nachází v klidné ulici K Říčanům v Praze-Kolovratech. Jednou z jeho největších výhod je výborná dopravní dostupnost do centra Prahy. Pouhých 5 minut chůze od domu je vlakové nádraží, odkud trvá cesta do centra jen 20 minut. Přímo před domem se navíc nachází autobusová zastávka Nad Parkánem, ze které lze pohodlně dojet na metro C Háje. V místě bydliště je také kompletní občanská vybavenost (ZŠ, MŠ, ZUŠ, obchody, restaurace, pošta atd.).

Dispozičně je byt řešen jako 3+kk (58 m2) + zahrada (126 m2) + kryté parkovací stání. Byt je vybaven kuchyňskou linkou a vestavěným nábytkem. V bytě je též optický internet.

Měsíční nájemné: 25.000 Kč;
Měsíční zálohy: 3.000 Kč;
Zálohy na elektřinu se převádí na nájemníka: 3.000 Kč;
Provize RK: 34.000 Kč vč. DPH;
Vratná kauce ve výši dvou nájmů.

Prohlídky budou probíhat v lednu 2025. Byt je následně volný od 1.2.2025.

Pokud je tento byt tím, co hledáte, pak mne kontaktujte a sjednejte si osobní prohlídku.
Těším se na viděnou!
Vojtěch Piruchta
